package vn.techres.order.online.v1.response;import com.fasterxml.jackson.annotation.JsonProperty;import lombok.AllArgsConstructor;import lombok.Data;import lombok.NoArgsConstructor;import java.util.List;@Data@AllArgsConstructor@NoArgsConstructorpublic class BranchResponse {    private int id;    private String name;    @JsonProperty("street_name")    private String streetName;    @JsonProperty("address_full_text")    private String addressFullText;    @JsonProperty("distance_km")    private double distanceKM;    public BranchResponse(vn.techres.microservice.grpc.java.elasticsearch.order_online_qr.BranchResponse entity) {        this.id = entity.getId();        this.name = entity.getName();        this.streetName = entity.getStreetName();;        this.addressFullText = entity.getAddressFullText();        this.distanceKM = entity.getDistanceKm();    }    public List<BranchResponse> mapToList(List<vn.techres.microservice.grpc.java.elasticsearch.order_online_qr.BranchResponse> entities) {        return entities.stream().map(BranchResponse::new).toList();    }}